import axios from 'axios'
import { API } from '../Constants'

export function CheckAuth(name, password) {
  return axios({
    headers: {
      'x-api-key': 'ysuw8tpzZaZNYUK99Ehg10RCvDQ919J1lGJRkXA4',
    },
    method: 'POST',
    baseURL: API + 'signin',
    data: {
      name: name,
      password: password,
    },
  })
}

export function Rsvp(rsvp, auth) {
  return axios({
    method: 'POST',
    baseURL: API + 'rsvp',
    headers: {
      authorization: auth,
    },
    data: {
      response: rsvp.response,
      text: rsvp.text,
      email: rsvp.email,
    },
  })
}

export function GetRsvp(auth) {
  return axios({
    method: 'POST',
    baseURL: API + 'getrsvp',
    headers: {
      authorization: auth,
    },
  })
}

export function GetList(auth) {
  return axios({
    method: 'POST',
    baseURL: API + 'getlist',
    headers: {
      authorization: auth,
    },
  })
}
